# Define the two hexadecimal strings
hex_str1 = ""
hex_str2 = ""

# Convert the hex strings to integers
int_val1 = int(hex_str1, 16)
int_val2 = int(hex_str2, 16)

# Find the difference
difference = abs(int_val1 - int_val2)

# Convert the difference back to hex
hex_difference = hex(difference)
print(hex_difference)